column8:
【医薬部外品】<br>
ユースキン リカAソフト 薬用ジェル<br>
薬用あせもジェル (140mL)<br>
<br>
汗による肌あれ、あせも予防に。<br>
<br>
・肌にうるおいを与え、汗による肌あれ“汗あれ”やあせもを予防します。<br>
・さっぱりとした使用感でたれにくいジェルタイプ。<br>
<br>
無香料・無着色・低刺激性<br>
<br>
【特長】<br>
・肌にのせてもたれにくく、全身に塗りやすいとろっとしたジェルタイプです。<br>
・水溶性ジェルなので、ベタつかないさっぱりとした使い心地です。<br>
・有効成分「グリチルリチン酸ジカリウム」が炎症を起こした肌を改善します。<br>
・3つのうるおい成分(植物エキス)配合でお肌にうるおいを与えます。<br>
・入浴後の清潔なお肌にご使用ください。<br>
・生後3ヶ月の赤ちゃんからお年寄りまで、ご家族みなさまでお使いください。<br>
<br>
【うるおい成分】<br>
・ももの葉エキス<br>
・アロエエキス<br>
・しその葉エキス <br>
<br>
【有効成分】<br>
グリチルリチン酸二カリウム <br>
<br>
【その他の成分】<br>
アラントイン <br>
モモ葉エキス <br>
アロエエキス(2) <br>
シソエキス(2) <br>
濃グリセリン <br>
1,3-ブチレングリコール<br>
3-メチル-1,3-ブタンジオール<br>
カルボキシビニルポリマー <br>
水酸化ナトリウム <br>
パラベン <br>
精製水 <br>
<br>
【お問い合わせ先】<br>
ユースキン製薬株式会社<br>
〒210‐0014 神奈川県川崎市川崎区貝塚1-1-11 <br>
お客さま相談室 TEL：0120-22-1413<br>
受付時間 土、日、祝日をのぞく午前9時～午後5時<br>
<br>
【リスク区分】 医薬部外品<br>
<br>
<hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
