【スキンピース ファミリー スキンクリーム 無香料の詳細】<br>
●家族全員で使える全身用保湿クリーム（こっくり濃厚クリームタイプ） 乾きの気になる赤ちゃんや大人の肌に、これ１本！<br>
●みずみずしさが不足した肌に。<br>
●赤ちゃんの顔・全身保湿に。<br>
●広い部分の乾燥や、髪の毛に。<br><br>

【使用方法】<br>
手のひらに適量をとり、洗顔後やお風呂あがりの清潔な肌にのばしてください。<br>
※使い始めの際は、キャップをはずし封印シールをはがしてからご使用ください。<br><br>

【ご注意】<br>
○お肌に異常が生じていないかよく注意してご使用ください。お肌に合わないときは、ご使用をおやめください。<br>
○目に入らないようご注意ください。入った場合は、こすらずにすぐ洗い流してください。目に異物感が残る場合は、眼科医にご相談ください。<br>
○赤み・はれ・かゆみ・刺激・色抜け（白斑等）・黒ずみ等や、直射日光にあたって左記のような異常が現れた時は、ご使用を中止し、皮膚科専門医にご相談ください。使い続けると症状が悪化することがあります。<br>
○高温または低温の場所、直射日光があたる場所、湿気の多い場所には保管しないでください。<br>
○乳幼児の手の届かない場所に保管してください。<br>
○開封後はできるだけ早くお使いください。<br><br>

【成分】<br>
水、PG、ミネラルオイル、ステアリン酸、ステアリルアルコール、シア脂、グリセリン、ラフィノース、α-グルカンオリゴサッカリド、ヒアルロン酸Na、オレンジ果皮油、シメチコン、ステアリン酸ソルビタン、ラウリン酸ポリグリセリル-10、ベヘン酸グリセリル、ジステアリン酸ポリグリセリル-10、セルロース、カラメル、ミツロウ、キサンタンガム、セルロースガム、パラフィン、水酸化K、安息香酸Na、プロピルパラベン<br><br>

【内容量】<br>
180g<br><br>

【販売元】<br>
株式会社グラフィコ<br>
お問い合わせ先：0120-498-177<br><br>

【商品区分】<br>
化粧品

